column8:
Продукт призначений для очищення всіх поверхонь, стійких до лужного середовища.

Його склад забезпечує відмінне змочування очищених поверхонь та ефективне емульгування бруду. Дуже легко видаляє бруд (масло, олію, жир). Розроблений для промислових сервісних служб із використаням механічного інструментарію та обладнання для миття під тиском.

&nbsp;
